import React,{Component} from 'react';


class TopNavRightIcon extends Component {
     
    render() {
        return (
            <div >
                <div class="col-lg-6 col-md-6 col-sm-12 col-xs-12">
                        <ul class="list-inline2">
                            <li>
                                <select id="basic" class="selectpicker show-tick form-control"
                                    placeholder="تسجيل الدخول" title="register">
                                    <a href="login.html" title="register" target="_blank">
                                        <option>سجل هنا</option>
                                    </a>
                                    <option><a href="register.html" title="register" target="_blank">الاشتراك</a>
                                    </option>
                                </select>
                                <i class="fas fa-users"></i>
                            </li>
                            <li><a href="tel:01028496209" title="Call me" target="_blank" class="mobile">01028496209<i
                                        class="fas fa-phone-alt"></i></a></li>
                            <li><a href="mailto:info@yourdomain.com" title="Mail" target="_blank">info@yourdomain.com<i
                                        class="far fa-envelope"></i></a></li>
                        </ul>
                    </div>
            </div>
        )
    };
}
export default TopNavRightIcon;
